import React from 'react'

const LoginPage = () => {
    return(
        <div className="single_page_background">
            <div style={login_div}>
                <div style={left_div}>

                </div>
                <div style={right_div}>
                    <p>Login</p>
                </div>
            </div>
        </div>
    );
}

const login_div = {
    width: "80%",
    height: "80%",
    backgroundColor: "#EEEEEE",
    position: "fixed",
    zIndex: "2",
    margin: "5% 10% 5% 10%",
    borderRadius: "10px"
}

const left_div = {
    width: "50%",
    float: "left"
}

const right_div = {
    width: "50%",
    float: "right"

}
export default LoginPage
